	public Set<Long> root = new HashSet<Long>();
	

	public void parse() {
		init();
		getUnknownFunc();
		measureWeight();
		System.err.println(PHPCGFactory.omitIds);
	}
	
	private void init() {
		for(Long node: neededIds) {
			LinkedList<Long> tmp = new LinkedList<Long>();
			value.put(node, tmp);
		}
		for(Long callsite: callGraph.keySet()) {
			for(Long func: callGraph.get(callsite)) {
				calledGraph.add(func, callsite);
			}
		}
		for(Long node: callGraph.keySet()) {
			if(ASTUnderConstruction.idToNode.get(node) instanceof TopLevelFunctionDef) {
				root.add(node);
			}
		}
	}
	
	private void getUnknownFunc() {
		for(Long callsite: PHPCGFactory.unknownIds) {
			Long funId = ASTUnderConstruction.idToNode.get(callsite).getFuncId();
			unknownFunc.add(funId);
		}
	}

	private void measureWeight() {
		//root
		//System.err.println("all needed functions "+neededIds.size());
		getAllAncestors();
		getAllChilds();
		getAllInEdges();
		getAllOutEdges();
		//System.err.println("FFF "+calledGraph.get((long) 49680));
		Map<Long, LinkedList<Long>> show = new TreeMap<Long, LinkedList<Long>>();
		for(Long node: value.keySet()) {
			if(ASTUnderConstruction.idToNode.get(node) instanceof TopLevelFunctionDef || 
					PHPCGFactory.magicMtdDefs.contains(node)) {
				continue;
			}
			//LinkedList<Long> tmp = value.get(node);
			Long sum = value.get(node).get(0)+value.get(node).get(1)+value.get(node).get(2)+value.get(node).get(3);
			if(sum < 0) {
				sum = Long.MAX_VALUE;
			}
			if(show.containsKey(sum)) {
				show.get(sum).add(node);
			}
			else {
				LinkedList<Long> tmp = new LinkedList<Long>();
				tmp.add(node);
				show.put(sum, tmp);
			}
		}
		Map<Long, LinkedList<Long>> sshow = new TreeMap<Long, LinkedList<Long>>();
		int stop = show.keySet().size(), i=0;
		for(Long weight: show.keySet()) {
			for(Long tmp: show.get(weight)) {
				i++;
				String path = FileDependencyCheck.getDir(tmp);
				String mtdpath = path+"$"+((FunctionDef)(ASTUnderConstruction.idToNode.get(tmp))).getName();
				if(Arrays.stream(removed).anyMatch(path::equals)
						|| Arrays.stream(removed).anyMatch(mtdpath::equals)) {
					//System.err.println(tmp + " " + value.get(tmp) + FileDependencyCheck.getDir(tmp)+"!");
				}
				else {
				//	System.err.println(tmp + " " + value.get(tmp) + FileDependencyCheck.getDir(tmp));
				}
				Long impact = (long) 0;
				for(Long prt: dp1.get(tmp)) {
					if(root.contains(prt)) {
						impact = impact+dp2.get(prt).size();
					}
				}
				if(root.contains(tmp)) {
					impact = impact + dp2.get(tmp).size();
				}
				if(impact==0) {
					if(calledGraph.containsKey(tmp)) {
						for(Long prt: calledGraph.get(tmp)) {
							impact = impact+dp2.get(prt).size();
						}
					}
					else {
						impact = impact+dp2.get(tmp).size();
					}
				}
				if(impact < 0) {
					impact = Long.MAX_VALUE;
				}
				//System.err.println(impact);
				if(sshow.containsKey(impact)) {
					sshow.get(impact).add(tmp);
				}
				else {
					LinkedList<Long> tmp1 = new LinkedList<Long>();
					tmp1.add(tmp);
					sshow.put(impact, tmp1);
				}
			}
		}
		for(Long impact: sshow.keySet()) {
			for(Long id: sshow.get(impact)) {
				String path = FileDependencyCheck.getDir(id);
				String mtdpath = path+"$ "+((FunctionDef)(ASTUnderConstruction.idToNode.get(id))).getName();
				if(Arrays.stream(removed).anyMatch(path::equals)
						|| Arrays.stream(removed).anyMatch(mtdpath::equals)) {
					System.err.println(mtdpath + " " + "!");
				}
				else {
					System.err.println(mtdpath + " ");
				}
			}
		}
	}

	private void getAllAncestors() {
		for(Long node: neededIds) {
			if(!dp1.containsKey(node)) {
				Set<Long> list = new HashSet<Long>();
				iterPath1(node, list);
			}
		}
		for(Long node: dp1.keySet()) {
			if(neededIds.contains(node)) {
				Long weight = (long) dp1.get(node).size();
				value.get(node).add(weight);
			}
		}
	}

	//get weight of node
	private void iterPath1(Long node, Set<Long> list) {
		//System.err.println(node);
		if(dp1.containsKey(node)) {
			return;
		}
		if(!calledGraph.containsKey(node)) {
			Set<Long> tmp = new HashSet<Long>();
			tmp.add(node);
			dp1.put(node, tmp);
			return;
		}
		Set<Long> tmp = new HashSet<Long>();
		tmp.add(node);
		list.add(node);
		for(Long parent: calledGraph.get(node)) {
			if(list.contains(parent)) {
				continue;
			}
			if(!dp1.containsKey(parent)) {
				iterPath1(parent, list);
			}
			tmp.addAll(dp1.get(parent));
		}
		list.remove(node);
		dp1.put(node, tmp);
	}

