	private void iterPath3(Long node, Set<Long> list) {
		if(dp3.containsKey(node)) {
			return;
		}
		if(!calledGraph.containsKey(node) ) {
			dp3.put(node, (long) 1);
			return;
		}
		list.add(node);
		Long tmp=(long) 0;
		for(Long parent: calledGraph.get(node)) {
			if( list.contains(parent)) {
				continue;
			}
			if(!dp3.containsKey(parent)) {
				iterPath3(parent, list);
			}
			tmp = tmp+dp3.get(parent);
			//dp3.put(node, tmp);
		}
		list.remove(node);
		if(tmp==0) {
			dp3.put(node, (long) dp1.get(node).size());
		}
		else if(tmp < 0) {
			dp3.put(node, Long.MAX_VALUE);
		}
		else {
			dp3.put(node, tmp);
		}
	}
	
